    basic_button_container_style(){
        return `#basic_button_container {
            user-select: none;
            display: flex;
            justify-items:start;
            border-radius: 3px;
            ${this.button_background_color}
            transition: background 0.3s;
        }`;
    }

    basic_button_name_style(){
        return `#basic_button_name {
            letter-spacing: 0.05em;
            font-family: arial, sans-serif;
            font-size: 1.5vw;
            padding-right: 0.3vw;
            padding-left: 0.3vw;
        }`;
    }

    render_initial_button() {
        this.shadowRoot.innerHTML = `
        <style>${this.button_style()}</style>
        <div id="basic_button_container">
        <div id="basic_button">
        <svg id="button_svg_icon" version="1.1" viewBox="0 0 432.32736 432.32735" xmlns="http://www.w3.org/2000/svg">
        ${this.render_button_svg_icon()}
        </svg>
        <div id="basic_button_name">${this.button_name}</div>
        </div>
        </div>`;
    }
